import '../style/GlobalStyle.css';

const Login = () => {

    return (
        <>
            <div className='login-pagebackground setcenter'>
                <div className='login-pageinner setcenter'>
                    <div className='login-formarea gifont'>

                        <div className='login-title setcenter'>
                            <h1>사용자 로그인</h1>
                        </div>

                        <div className='login-input'>
                            <input className='login-inputtag' value={''} placeholder='아이디를 입력해주세요'/>
                            <input className='login-inputtag' value={''} placeholder='비밀번호를 입력해주세요'/>
                            <button/>
                        </div>


                        
                    </div>
                </div>
            </div>
        </>
    )
}

export default Login;
